import React from "react";
import Nav from "react-bootstrap/Nav";
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import { LoginContext } from "../Contexts/LoginContext";
import { useState } from "react";
import Login from "../../pages/Login";
import Rent from "../../pages/Rent";
import Update from "../../pages/Update";
import ProtectedRoutes from "../../pages/ProtectedRoutes";

import Profile from "../../pages/Profile";

function Navbar_Customer({ userId, isAuth, setUserId }) {
  const handleSelect = (eventKey) => alert(`selected ${eventKey}`);

  console.log(userId);

  return (
    <Router>
      <div>
        <Nav bg="dark" variant="pills" activeKey="1" onSelect={handleSelect}>
          <Nav.Item>
            <Nav.Link as={Link} to={"/rent"}>
              Rent
            </Nav.Link>
          </Nav.Item>

          <Nav.Item>
            <Nav.Link as={Link} to={`/profile/${userId}`}>
              Profile
            </Nav.Link>
          </Nav.Item>
        </Nav>
      </div>
      <div>
        <Route path="/rent" component={Rent}></Route>
        <LoginContext.Provider value={{ isAuth, setIsAuth, userId, setUserId }}>
          <Route path="/login" component={Login}></Route>

          <ProtectedRoutes
            path="/profile/:userId"
            component={Profile}
            isAuth={isAuth}
          />
          <ProtectedRoutes path="/update" component={Update} isAuth={isAuth} />
        </LoginContext.Provider>
      </div>
    </Router>
  );
}

export default Navbar_Customer;
